import React from "react";
import { Link } from "react-router-dom";


const Navbar = () => {
    return ( 
        <div>
           <div class="navbar">
   <div id="navbar-brand">
    {/* <img src="http://icons.iconarchive.com/icons/sirubico/black-metal/128/Web-b-icon.png"> */}
   </div>
  <button id="html"><span id="htmltxt">HTML</span></button>
  <button id="css"><span id="htmltxt">CSS</span></button>
  <button id="JS"><span id="htmltxt">JavaScript</span></button>
  <button id="css"><span id="htmltxt">PHP</span></button>
  <button id="css"><span id="htmltxt">jQuery</span></button>
  <button id="css"><span id="htmltxt">mySQL</span></button>
 
  {/* <img src="http://icons.iconarchive.com/icons/visualpharm/icons8-metro-style/128/System-Login-icon.png" id="login"> */}
    
</div>
<br></br>
<div id="container">
  <h1></h1>
</div>
        </div>
     );
}
 
export default Navbar;
